import React, { Component } from "react";

class Posts extends Component {
  render() {
    return (
      <div>
        <h2>POSTS</h2>
        <p>See a list of all posts on your page!</p>
        <ol>
          <li>Post 1</li>
          <li>Post 2</li>
          <li>Post 3</li>
        </ol>
      </div>
    );
  }
 }

export default Posts;
